import React from 'react'
import './Home.css'
import Header from '../Components/Header'; 
function Home() {
    return (
        <div className='home'>
            <Header/>
            <div className='landing-section'>
                    <h1 className="landing-section-title">Create Digital <br/> agency</h1>
            </div>
        </div>
    )
}

export default Home;
